import { styled } from "styled-components";
import dataDetail from "../../../data/detail.json";

const StyleImg = styled.div`
  display: flex;
  justify-content: space-around;
  flex-wrap: wrap;
  min-width: 1520px;

  img {
    width: 200px;
    height: 200px;
  }
`;
export default function ListImage() {
  return (
    <StyleImg>
      {dataDetail.photos.map((item) => (
        <img src={item} alt="" />
      ))}
    </StyleImg>
  );
}
